def lucid_number(n):
  """
  This function aims to find a lucid number less than or equal to n.
  Lucid numbers are defined as integers whose prime factors are distinct and
  are present as digits in the number itself.
  The function uses a combination of primality testing and digit extraction
  to achieve this goal.
  """
  def is_prime(num):
    if num <= 1:
      return False
    for i in range(2, int(num**0.5) + 1):
      if num % i == 0:
        return False
    return True

  def get_digits(num):
    return [int(d) for d in str(num)]

  for i in range(1, n + 1):
    prime_factors = []
    for j in get_digits(i):
      if is_prime(j):
        if j not in prime_factors:
          prime_factors.append(j)
        else:
          break
    if len(prime_factors) == len(set(get_digits(i))):
      return
